// Set up interaction on newsletter units
Atlantic.setUpNewsletterSignUp = function (selector, api_endpoint) {

    var successMsg = function ($el, msg) {
        $el.find('.message').removeClass('error').addClass('success').html(msg);
    };

    var errorMsg = function ($el, msg) {
        $el.find('.message').removeClass('success').addClass('error').html('<strong>Error:</strong> ' + msg);
    };

    $(document).on("submit", selector, function(e){
        var $this = $(this);
        var $form = $this.is("form") ? $this : $this.find('form');
        var $inputs = $form.find("input");

        var trackingId = (this.id) ? this.id.replace(/\s/g, "-") : "unknown";

        // Lock and fade the form
        $inputs.css('opacity', '0.5').attr('readonly', true);

        $.ajax({
            url: api_endpoint,
            type: 'POST',
            dataType: 'json',
            data: $form.serialize(),
            success: function(data, statusText, xhr) {

                // Unlock form to allow resubmission
                $inputs.css('opacity', '1').attr('readonly', false);

                if (data && data.success) {
                    if (data.existing_user === true) {
                       successMsg($this, "Your newsletter subscription preferences have been updated.");
                    } else {
                       successMsg($this, "<strong>You're almost finished.</strong><br/><br />" +
                        " We just need to confirm your email address." +
                        "<br/><br />" +
                        "To complete the subscription process, please click " +
                        "the link in the email we just sent you.");
                    }
                    Atlantic.Omniture.trackLink('newslettersubmit`' + trackingId, true, true);
                } else if (data && data.error) {
                    errorMsg(data.error);
                } else {
                    errorMsg("An unknown error occurred.");
                }
            },
            error: function() {
                errorMsg("An unknown error occurred.");
            }
        });

        e.preventDefault();
        e.stopPropagation();

    });
};

